import React, { Component } from 'react';



export default class Circuits extends Component {

    constructor(props) {
        super(props);
        this.state = { 
            yearsCircuits: []
        };
    }


    render() {

        const { yearsCircuits } = this.props;

        return (
            <div>
                <div className={'list-circuits'}>
                    <ul>
                    {yearsCircuits.map((yearsCircuits) => {
                        return (
                            <li>
                                <a href="#">{ yearsCircuits.raceName }</a>
                            </li>                        
                        )
                        })
                    }

                    </ul>
                </div>
            </div>
        );
    }
}
